bool deleteFilesRecursively(const char* path) {
    struct _finddata_t entry;
    intptr_t search_handle;
    char full_path[256];
    int res;

    // Build the search path using directory path with `*` wildcard
    sprintf_s(full_path, sizeof(full_path), "%s/*", path);

    // Find the first file in the directory
    search_handle = _findfirst(full_path, &entry);
    if (search_handle == -1)
        return true;        // No files found, return true to represent successful deletion

    do {
        if (strcmp(entry.name, ".") != 0 && strcmp(entry.name, "..") != 0) {

           // Build the absolute file path
            sprintf_s(full_path, sizeof(full_path), "%s/%s", path, entry.name);

            // If a subfolder is found then delete files recursively inside it
            if (entry.attrib & _A_SUBDIR) {
                deleteFilesRecursively(full_path);
            }

            // Delete file
            remove(full_path);
        }

        // Find the next file in the directory
        res = _findnext(search_handle, &entry);
    } while (res != -1);

    // Close handle and return false if no errors occured    
    _findclose(search_handle);
    return true;
}

int main() {
    char path[256];

    printf("Enter the Directory path to delete files recursively: ");
    fgets(path, sizeof(path), stdin);

    // Removing trailing '\n' character from input (~ strlen - 1)
    size_t len = strlen(path);
    if (path[len - 1] == '\n') {
		len--;
		path[len] = '\0';
    }

    // Check if the provided directory exist or not
    if (_chdir(path) != -1 ) {
        // If it exists, delete recursively by iterating over files
        if (deleteFilesRecursively(path)) {
            printf("All files in the directory have been deleted successfully.\n");
        }
        else {
            printf("Failed to delete files in the given directory.\n");
        }
    } else {
        printf("Directory \"%s\" doesn't exist.\n", path);
    }

    return 0;
}
